values:
Tomorrow morning I'm leaving my aunt's house at 5:30am to head to the airport for a 7:30am flight to JFK in New York... then I have a layover until I head to Orlando, FL! I can't wait to experience Florida, see Phil, and maybe even go to the Harry Potter thingy at Universal!&nbsp;

I'm sure I'll be able to use Phil computer while I'm there so I'll update every now and then!

Peace out!

So... just to tell everyone...

I GOT THE JOB AT SOLANO YOUTH THEATRE!!!!!!!!!!! AND IT'S FOR ALL FOUR WEEKS! THAT'S LIKE... $3,000! AND I GET TO WORK WITH MANI!&nbsp;

Okay... peace out!

So... I guess I shouldn't have jumped to the conclusion that flag twirling was gonna suck... cuz at least what we do in "Brass Band" is kinda fun! The flags are home-made and not heavy at all. Although, I do have a feeling I'll be a bit sore tomorrow.

I'm tired...&nbsp;

Tomorrow is gonna be a busy day! I have to work, then go teach at the high school, take Smandon to lunch, go to PT, then come home and hopefully see Opie for a little bit. Then I'm meeting Mani at the high school at 6pm... we're getting dinner and then seeing the DVC musical. That's a lot of non stop action!

I did a butt load of laundry today! I always feel accomplished after doing laundry... and I don't know why. I get that same feeling with dishes too.&nbsp;

Peace out!
